tween each node in the bottom layer","location":{"start":{"column":8,"line":171}}},{"id":"10","name":"skip list constructor includes long, randomized collection params returns the correct length","location":{"start":{"column":8,"line":193}}},{"id":"11","name":"skip list constructor includes long, randomized collection params does not create a list where all nodes are present in all layers","location":{"start":{"column":8,"line":197}}},{"id":"12","name":"skip list constructor includes maxPromotions arg results in a list 10 layers deep","location":{"start":{"column":8,"line":229}}},{"id":"13","name":"skip list contains should return false when the list is empty","location":{"start":{"column":6,"line":240}}},{"id":"14","name":"skip list contains should return false when the list does not contain the target value","location":{"start":{"column":6,"line":248}}},{"id":"15","name":"skip list contains should return true when the list contains the target value","location":{"start":{"column":6,"line":261}}},{"id":"16","name":"skip list insert should insert a new head node when called on an empty list","location":{"start":{"column":6,"line":284}}},{"id":"17","name":"skip list insert should not alter the list structure when attempting to add duplicate elements greater than the head","location":{"start":{"column":6,"line":292}}},{"id":"18","name":"skip list insert should not alter the list structure when attempting to add the same value as the head","location":{"start":{"column":6,"line":303}}},{"id":"19","name":"skip list insert should trigger random promotions","location":{"start":{"column":6,"line":314}}},{"id":"20","name":"skip list insert should correctly insert new values between current ones","location":{"start":{"column":6,"line":332}}},{"id":"21","name":"skip list insert should correctly insert a new head value when the value is less than all elements in the list","location":{"start":{"column":6,"line":351}}},{"id":"22","name":"skip list remove does not change an empty list","location":{"start":{"column":6,"line":374}}},{"id":"23","name":"skip list remove correctly removes the head node from a single element skip list","location":{"start":{"column":6,"line":383}}},{"id":"24","name":"skip list remove short fixed list does not change the structure of a list if the list does not contain the target value","location":{"start":{"column":8,"line":408}}},{"id":"25","name":"skip list remove short fixed list completely removes the correct element from the list when targeting a value that is neither at the start nor end of the list","location":{"start":{"column":8,"line":416}}},{"id":"26","name":"skip list remove short fixed list completely removes the correct element from the list when targeting the end value of the list","location":{"start":{"column":8,"line":426}}},{"id":"27","name":"skip list remove short fixed list completely removes the head column when targeting the head value","location":{"start":{"column":8,"line":436}}},{"id":"28","name":"skip list at (indexing) invalid list should throw a MissingIndexError when 'at' is called for an index that appears to be skipped","location":{"start":{"column":8,"line":450}}},{"id":"29","name":"skip list at (indexing) short fixed list should throw an OutOfBoundsError when called with an invalid index","location":{"start":{"column":8,"line":487}}},{"id":"30","name":"skip list at (indexing) short fixed list returns the correct value for each index","location":{"start":{"column":8,"line":497}}},{"id":"31","name":"skip list at (indexing) short fixed list returns the correct value for each index after one remove operation","location":{"start":{"column":8,"line":504}}},{"id":"32","name":"skip list at (indexing) short fixed list returns the correct value for each index after one insert operation (past the end of the list)","location":{"start":{"column":8,"line":511}}},{"id":"33","name":"skip list at (indexing) short fixed list returns the correct value for each index after inserting a new head value","location":{"start":{"column":8,"line":518}}},{"id":"34","name":"skip list at (indexing) short fixed list returns the correct value for each index after several insert/remove operations","location":{"start":{"column":8,"line":525}}},{"id":"35","name":"skip list at (indexing) includes long, randomized collection params returns the correct value for each index","location":{"start":{"column":8,"line":560}}},{"id":"36","name":"skip list at (indexing) includes long, randomized collection params returns the correct value for each index after one remove operation","location":{"start":{"column":8,"line":564}}},{"id":"37","name":"skip list at (indexing) includes long, randomized collection params returns the correct value for each index after one insert operation (past the end of the list)","location":{"start":{"column":8,"line":568}}},{"id":"38","name":"skip list at (indexing) includes long, randomized collection params returns the correct value for each index after inserting a new head value","location":{"start":{"column":8,"line":572}}}],"source":"import { randomInt } from \"crypto\";\nimport { SkipList, SkipListNode } from \"./skip-list\";\nimport {\n  arrayCopyToFunction,\n  arrayEmptyConstructor,\n  deleteObjectProperties,\n} from \"../util\";\nimport { mergeSort } from \"../algorithms/sort-linear-collection\";\nimport { MissingIndexError, OutOfBoundsError } from \"../error\";\n\nconst probabilityFunctions = {\n  always() {\n    // will cause an infinite loop if maxPromotions is not set\n    return true;\n  },\n  never() {\n    return false;\n  },\n  half() {\n    return randomInt(2) === 0;\n  },\n};\n\nconst createCollectionParams = (array: Array<"+"number>) => {\n  return {\n    collection: array,\n    copyToFunction: arrayCopyToFunction,\n    constructor: arrayEmptyConstructor,\n  };\n};\n\nfunction testBasicIndexing(list: SkipList<"+"number>, inputArray: number[]) {\n  expect(list.values).toStrictEqual(inputArray);\n  for (let j = 0, length = list.values.length; j <"+" length; j++) {\n    expect(list.at(j)).toBe(inputArray.at(j));\n  }\n}\n\nfunction testIndexingAfterRemove(inputArray: number[], list: SkipList<"+"number>) {\n  const valueToRemove = inputArray[randomInt(inputArray.length)];\n  const expectedArray = inputArray.filter((value) => value !== valueToRemove);\n  for (let i = 0, length = list.values.length; i <"+" length; i++) {\n    expect(list.at(i)).toBe(inputArray.at(i));\n  }\n  list.remove(valueToRemove);\n  for (let i = 0, length = list.values.length; i <"+" length; i++) {\n    expect(list.at(i)).toBe(expectedArray.at(i));\n  }\n}\n\nfunction testIndexingAfterInsertionOfNewHead(\n  inputArray: number[],\n  list: SkipList<"+"number>,\n) {\n  const expectedArray = structuredClone(inputArray);\n  const valueToInsert = -1 * randomInt(100);\n  expectedArray.unshift(valueToInsert);\n  for (let i = 0, length = list.values.length; i <"+" length; i++) {\n    expect(list.at(i)).toBe(list.values.at(i));\n  }\n  list.insert(valueToInsert);\n  for (let i = 0, length = list.values.length; i <"+" length; i++) {\n    expect(list.at(i)).toBe(expectedArray.at(i));\n  }\n}\n\nfunction testIndexingAfterInsertionPastEnd(\n  inputArray: number[],\n  list: SkipList<"+"number>,\n) {\n  const expectedArray = structuredClone(inputArray);\n  const valueToInsert = expectedArray[expectedArray.length - 1] + 1;\n  expectedArray.push(valueToInsert);\n  for (let i = 0, length = list.values.length; i <"+" length; i++) {\n    expect(list.at(i)).toBe(inputArray.at(i));\n  }\n  list.insert(valueToInsert);\n  for (let i = 0, length = list.values.length; i <"+" length; i++) {\n    expect(list.at(i)).toBe(expectedArray.at(i));\n  }\n}\n\nconst simpleInputArray = [1, 2, 3, 4, 5];\n\nconst createLongRandomInputArray = (length: number) => {\n  if (length > 1000) {\n    throw new Error(\n      \"Lengths > 1000 are likely too slow to generate for testing (lengths >= 100000 result in an infinite loop)\",\n    );\n  }\n  const input: Set<"+"number> = new Set();\n  for (let i = 0; i <"+" length; i++) {\n    let nextRandomNum = randomInt(100000);\n    while (input.has(nextRandomNum)) {\n      nextRandomNum = randomInt(100000);\n    }\n    input.add(nextRandomNum);\n  }\n  const array = Array.from(input);\n  mergeSort(array, arrayCopyToFunction, arrayEmptyConstructor);\n  return array;\n};\n\ndescribe(\"skip list\", () => {\n  describe(\"constructor\", () => {\n    describe(\"no collection parameter passed in\", () => {\n      let list: SkipList<"+"number>;\n      beforeEach(() => {\n        list = new SkipList<"+"number>(probabilityFunctions.half);\n      });\n\n      it(\"does not assign a head\", () => {\n        expect(list.head).toBeUndefined();\n      });\n\n      it(\"returns zero length\", () => {\n        expect(list.length).toBe(0);\n      });\n    });\n\n    describe(\"empty array collection parameter passed in\", () => {\n      let list: SkipList<"+"number>;\n      beforeEach(() => {\n        list = new SkipList<"+"number>(\n          probabilityFunctions.half,\n          createCollectionParams([]),\n        );\n      });\n\n      it(\"values getter return an empty array for an empty skip list\", () => {\n        expect(list.values).toStrictEqual([]);\n      });\n\n      it(\"does not assign a head\", () => {\n        expect(list.head).toBeUndefined();\n      });\n\n      it(\"returns zero length\", () => {\n        expect(list.length).toBe(0);\n      });\n\n      it(\"should throw an OutOfBoundsError when called with an invalid index\", () => {\n        expect(() => {\n          list.at(0);\n        }).toThrow(OutOfBoundsError);\n      });\n    });\n\n    describe(\"includes fixed collection params\", () => {\n      let list: SkipList<"+"number>;\n      const inputArray = simpleInputArray;\n      beforeEach(() => {\n        list = new SkipList<"+"number>(\n          probabilityFunctions.half,\n          createCollectionParams(inputArray),\n        );\n      });\n\n      it(\"assigns a head with the correct value\", () => {\n        expect(list.head?.data).toBe(1);\n      });\n\n      it(\"returns the correct length\", () => {\n        expect(list.length).toBe(5);\n      });\n\n      it(\"returns the correct values for the lowest layer\", () => {\n        expect(list.values).toStrictEqual([1, 2, 3, 4, 5]);\n      });\n\n      it(\"returns the correct nextLength between each node in the bottom layer\", () => {\n        let node = list.head;\n        while (node!.down !== undefined) {\n          node = node!.down;\n        }\n        while (node!.next !== undefined) {\n          expect(node!.nextLength).toBe(1);\n          node = node?.next;\n        }\n      });\n    });\n\n    describe(\"includes long, randomized collection params\", () => {\n      let list: SkipList<"+"number>;\n      const inputArray = createLongRandomInputArray(200);\n      beforeEach(() => {\n        list = new SkipList<"+"number>(\n          probabilityFunctions.half,\n          createCollectionParams(inputArray),\n        );\n      });\n\n      it(\"returns the correct length\", () => {\n        expect(list.length).toBe(200);\n      });\n\n      it(\"does not create a list where all nodes are present in all layers\", () => {\n        const rowItemCounts: Set<"+"number> = new Set();\n        for (\n          let startNode = list.head;\n          startNode !== undefined;\n          startNode = startNode.down\n        ) {\n          let rowItemCount = 0;\n          for (\n            let node: SkipListNode<"+"number> | undefined = startNode;\n            node !== undefined;\n            node = node.next\n          ) {\n            rowItemCount += 1;\n          }\n          rowItemCounts.add(rowItemCount);\n        }\n        expect(rowItemCounts.size).toBeGreaterThan(1);\n      });\n    });\n\n    describe(\"includes maxPromotions arg\", () => {\n      let list: SkipList<"+"number>;\n      const inputArray = simpleInputArray;\n      beforeEach(() => {\n        list = new SkipList<"+"number>(\n          probabilityFunctions.always,\n          createCollectionParams(inputArray),\n          10,\n        );\n      });\n\n      it(\"results in a list 10 layers deep\", () => {\n        let count = 0;\n        for (let node = list.head!; node.down !== undefined; node = node.down) {\n          count += 1;\n        }\n        expect(count).toBe(10);\n      });\n    });\n  });\n\n  describe(\"contains\", () => {\n    it(\"should return false when the list is empty\", () => {\n      const list = new SkipList<"+"number>(\n        probabilityFunctions.half,\n        createCollectionParams([]),\n      );\n      expect(list.contains(0)).toBe(false);\n    });\n\n    it(\"should return false when the list does not contain the target value\", () => {\n      const array = [-2, 1, 5, 7, 9, 10, 15, 19];\n      const list = new SkipList<"+"number>(\n        probabilityFunctions.half,\n        createCollectionParams(array),\n      );\n      for (let i = -5; i <"+" 20; i++) {\n        if (!array.includes(i)) {\n          expect(list.contains(i)).toBe(false);\n        }\n      }\n    });\n\n    it(\"should return true when the list contains the target value\", () => {\n      const array = [-2, 1, 5, 7, 9, 10, 15, 19];\n      const list = new SkipList<"+"number>(\n        probabilityFunctions.half,\n        createCollectionParams(array),\n      );\n      for (let i = -5; i <"+" 20; i++) {\n        if (array.includes(i)) {\n          expect(list.contains(i)).toBe(true);\n        }\n      }\n    });\n  });\n\n  describe(\"insert\", () => {\n    let list: SkipList<"+"number>;\n    beforeEach(() => {\n      list = new SkipList<"+"number>(\n        probabilityFunctions.half,\n        createCollectionParams([]),\n      );\n    });\n\n    it(\"should insert a new head node when called on an empty list\", () => {\n      expect(list.head).toBeUndefined();\n      list.insert(123);\n      expect(list.head).toBeDefined();\n      expect(list.head!.data).toBe(123);\n      expect(list.head!.nextLength).toBeUndefined();\n    });\n\n    it(\"should not alter the list structure when attempting to add duplicate elements greater than the head\", () => {\n      list.insert(1);\n      list.insert(2);\n      list.insert(3);\n      expect(list.length).toBe(3);\n      const initial = list.toString();\n      list.insert(3);\n      expect(list.length).toBe(3);\n      expect(list.toString()).toStrictEqual(initial);\n    });\n\n    it(\"should not alter the list structure when attempting to add the same value as the head\", () => {\n      list.insert(1);\n      list.insert(2);\n      list.insert(3);\n      expect(list.length).toBe(3);\n      const initial = list.toString();\n      list.insert(1);\n      expect(list.length).toBe(3);\n      expect(list.toString()).toStrictEqual(initial);\n    });\n\n    it(\"should trigger random promotions\", () => {\n      let previousState = \"\";\n      for (let i = 0; i <"+" 100; i++) {\n        list = new SkipList<"+"number>(\n          probabilityFunctions.half,\n          createCollectionParams([]),\n        );\n        for (let j = 0; j <"+" 100; j++) {\n          list.insert(j);\n        }\n        const currentState = list.toString();\n        // for the first iteration, this assertion is less important but does\n        // not need to be skipped\n        expect(currentState).not.toStrictEqual(previousState);\n        previousState = currentState;\n      }\n    });\n\n    it(\"should correctly insert new values between current ones\", () => {\n      for (let i = 0; i <"+" 100; i++) {\n        list = new SkipList<"+"number>(\n          probabilityFunctions.half,\n          createCollectionParams([1, 3, 5]),\n        );\n        const previousState = list.toString();\n        expect(list.length).toBe(3);\n        expect(list.values).toStrictEqual([1, 3, 5]);\n        expect(previousState).not.toMatch(/4\\(/);\n        list.insert(4);\n        const currentState = list.toString();\n        expect(list.length).toBe(4);\n        expect(list.values).toStrictEqual([1, 3, 4, 5]);\n        expect(currentState).toMatch(/4\\(/);\n        expect(currentState).not.toStrictEqual(previousState);\n      }\n    });\n\n    it(\"should correctly insert a new head value when the value is less than all elements in the list\", () => {\n      for (let i = 0; i <"+" 100; i++) {\n        list = new SkipList<"+"number>(\n          probabilityFunctions.half,\n          createCollectionParams([2, 3, 4]),\n        );\n        const previousState = list.toString();\n        expect(list.length).toBe(3);\n        expect(list.head!.data).toBe(2);\n        expect(list.values).toStrictEqual([2, 3, 4]);\n        expect(previousState).not.toMatch(/1\\(/);\n        list.insert(1);\n        const currentState = list.toString();\n        expect(list.length).toBe(4);\n        expect(list.head!.data).toBe(1);\n        expect(list.values).toStrictEqual([1, 2, 3, 4]);\n        expect(currentState).toMatch(/1\\(/);\n        expect(currentState).not.toStrictEqual(previousState);\n      }\n    });\n  });\n\n  describe(\"remove\", () => {\n    it(\"does not change an empty list\", () => {\n      const list = new SkipList<"+"number>(probabilityFunctions.half);\n      expect(list.length).toBe(0);\n      const previousState = list.toString();\n      list.remove(0);\n      expect(list.length).toBe(0);\n      expect(list.toString()).toBe(previousState);\n    });\n\n    it(\"correctly removes the head node from a single element skip list\", () => {\n      const list = new SkipList<"+"number>(\n        probabilityFunctions.half,\n        createCollectionParams([0]),\n      );\n      const previousState = list.toString();\n      expect(list.length).toBe(1);\n      expect(previousState).toMatch(/0\\(/);\n      list.remove(0);\n      const currentState = list.toString();\n      expect(list.length).toBe(0);\n      expect(currentState).not.toMatch(/4\\(/);\n      expect(currentState).not.toBe(previousState);\n    });\n\n    describe(\"short fixed list\", () => {\n      let list: SkipList<"+"number>;\n      const inputArray = simpleInputArray;\n      beforeEach(() => {\n        list = new SkipList<"+"number>(\n          probabilityFunctions.half,\n          createCollectionParams(inputArray),\n        );\n      });\n\n      it(\"does not change the structure of a list if the list does not contain the target value\", () => {\n        expect(list.values).toStrictEqual([1, 2, 3, 4, 5]);\n        const previousState = list.toString();\n        list.remove(6);\n        expect(list.values).toStrictEqual([1, 2, 3, 4, 5]);\n        expect(list.toString()).toStrictEqual(previousState);\n      });\n\n      it(\"completely removes the correct element from the list when targeting a value that is neither at the start nor end of the list\", () => {\n        expect(list.values).toStrictEqual([1, 2, 3, 4, 5]);\n        const previousState = list.toString();\n        expect(previousState).toMatch(/4\\(/);\n        list.remove(4);\n        expect(list.values).toStrictEqual([1, 2, 3, 5]);\n        expect(list.toString()).not.toMatch(/4\\(/);\n        expect(list.toString()).not.toStrictEqual(previousState);\n      });\n\n      it(\"completely removes the correct element from the list when targeting the end value of the list\", () => {\n        expect(list.values).toStrictEqual([1, 2, 3, 4, 5]);\n        const previousState = list.toString();\n        expect(previousState).toMatch(/5\\(/);\n        list.remove(5);\n        expect(list.values).toStrictEqual([1, 2, 3, 4]);\n        expect(list.toString()).not.toMatch(/5\\(/);\n        expect(list.toString()).not.toStrictEqual(previousState);\n      });\n\n      it(\"completely removes the head column when targeting the head value\", () => {\n        expect(list.values).toStrictEqual([1, 2, 3, 4, 5]);\n        const previousState = list.toString();\n        expect(previousState).toMatch(/1\\(/);\n        list.remove(1);\n        expect(list.values).toStrictEqual([2, 3, 4, 5]);\n        expect(list.toString()).not.toMatch(/1\\(/);\n        expect(list.toString()).not.toStrictEqual(previousState);\n      });\n    });\n  });\n\n  describe(\"at (indexing)\", () => {\n    describe(\"invalid list\", () => {\n      it(\"should throw a MissingIndexError when 'at' is called for an index that appears to be skipped\", () => {\n        for (let k = 0; k <"+" 100; k++) {\n          const list = new SkipList<"+"number>(\n            probabilityFunctions.never,\n            createCollectionParams(simpleInputArray),\n          );\n          // increase the nextLength of the middle node by 1, simulating a skipped index at the next node\n          const middleValue = list.values.at(2);\n          for (\n            let startNode: SkipListNode<"+"number> | undefined = list.head!;\n            startNode !== undefined;\n            startNode = startNode.down\n          ) {\n            for (\n              let node: SkipListNode<"+"number> | undefined = startNode;\n              node !== undefined;\n              node = node.next\n            ) {\n              if (node.data === middleValue) {\n                node.nextLength! += 1;\n              }\n            }\n          }\n          expect(() => list.at(3)).toThrow(MissingIndexError);\n        }\n      });\n    });\n    describe(\"short fixed list\", () => {\n      let list: SkipList<"+"number>;\n      const inputArray = simpleInputArray;\n      const initialize = () => {\n        list = new SkipList<"+"number>(\n          probabilityFunctions.half,\n          createCollectionParams(inputArray),\n        );\n      };\n\n      it(\"should throw an OutOfBoundsError when called with an invalid index\", () => {\n        initialize();\n        expect(() => {\n          list.at(-1);\n        }).toThrow(OutOfBoundsError);\n        expect(() => {\n          list.at(list.length);\n        }).toThrow(OutOfBoundsError);\n      });\n\n      it(\"returns the correct value for each index\", () => {\n        for (let i = 0; i <"+" 100; i++) {\n          initialize();\n          testBasicIndexing(list, inputArray);\n        }\n      });\n\n      it(\"returns the correct value for each index after one remove operation\", () => {\n        for (let i = 0; i <"+" 100; i++) {\n          initialize();\n          testIndexingAfterRemove(inputArray, list);\n        }\n      });\n\n      it(\"returns the correct value for each index after one insert operation (past the end of the list)\", () => {\n        for (let i = 0; i <"+" 100; i++) {\n          initialize();\n          testIndexingAfterInsertionPastEnd(inputArray, list);\n        }\n      });\n\n      it(\"returns the correct value for each index after inserting a new head value\", () => {\n        for (let i = 0; i <"+" 100; i++) {\n          initialize();\n          testIndexingAfterInsertionOfNewHead(inputArray, list);\n        }\n      });\n\n      it(\"returns the correct value for each index after several insert/remove operations\", () => {\n        initialize();\n        const expectedArray = [-1, 1, 4, 5, 6, 7];\n\n        for (let i = 0, length = list.values.length; i <"+" length; i++) {\n          expect(list.at(i)).toBe(inputArray.at(i));\n        }\n\n        list.remove(2);\n        list.insert(-1);\n        list.insert(6);\n        list.remove(5);\n        list.remove(3);\n        list.insert(5);\n        list.insert(7);\n\n        for (let i = 0, length = list.values.length; i <"+" length; i++) {\n          expect(list.at(i)).toBe(expectedArray.at(i));\n        }\n      });\n    });\n\n    describe(\"includes long, randomized collection params\", () => {\n      let list: SkipList<"+"number>;\n      const inputArray = createLongRandomInputArray(200);\n      const initialize = () => {\n        list = new SkipList<"+"number>(\n          probabilityFunctions.half,\n          createCollectionParams(inputArray),\n        );\n      };\n      beforeEach(() => {\n        initialize();\n      });\n\n      it(\"returns the correct value for each index\", () => {\n        testBasicIndexing(list, inputArray);\n      });\n\n      it(\"returns the correct value for each index after one remove operation\", () => {\n        testIndexingAfterRemove(inputArray, list);\n      });\n\n      it(\"returns the correct value for each index after one insert operation (past the end of the list)\", () => {\n        testIndexingAfterInsertionPastEnd(inputArray, list);\n      });\n\n      it(\"returns the correct value for each index after inserting a new head value\", () => {\n        testIndexingAfterInsertionOfNewHead(inputArray, list);\n      });\n    });\n  });\n});\n"},"src/data-structures/binary-search-tree.test.ts":{"tests":[{"id":"39","name":"traversal in-order traversal given binary tree {\"root\": [BinaryTreeNode]}, visits nodes in-order and constructs array with length [123] and value %p","location":{"start":{"column":20,"line":285}}},{"id":"40","name":"traversal in-order traversal given binary tree {\"root\": [BinaryTreeNode]}, visits nodes in-order and constructs array with length [2, 4, 6, 8, 10, 20] and value %p","location":{"start":{"column":20,"line":285}}},{"id":"41","name":"traversal pre-order traversal given binary tree {\"root\": [BinaryTreeNode]}, visits nodes pre-order and constructs array with length [123] and value %p","location":{"start":{"column":20,"line":285}}},{"id":"42","name":"traversal pre-order traversal given binary tree {\"root\": [BinaryTreeNode]}, visits nodes pre-order and constructs array with length [8, 4, 2, 6, 10, 20] and value %p","location":{"start":{"column":20,"line":285}}},{"id":"43","name":"traversal post-order traversal given binary tree {\"root\": [BinaryTreeNode]}, visits nodes post-order and constructs array with length [123] and value %p","location":{"start":{"column":20,"line":285}}},{"id":"44","name":"traversal post-order traversal given binary tree {\"root\": [BinaryTreeNode]}, visits nodes post-order and constructs array with length [2, 6, 4, 20, 10, 8] and value  = next.left;\n  next.left = new BinaryTreeNode<"+"number>(2);\n  next.right = new BinaryTreeNode<"+"number>(12);\n\n  next = root.right!;\n  next.right = new BinaryTreeNode<"+"number>(20);\n\n  return new BinaryTree(root);\n};\n\nconst createTreePerfect = () => {\n  /* Complete, full, perfect\n   *               ____________( 8 )____________\n   *              /                             \\\n   *       ____( 4 )____                   ____(10)____\n   *      /             \\                 /            \\\n   *   ( 2 )           ( 6 )           ( 9 )          (20)\n   */\n  const root = new BinaryTreeNode<"+"number>(8);\n\n  let next = root;\n  next.left = new BinaryTreeNode<"+"number>(4);\n  next.right = new BinaryTreeNode<"+"number>(10);\n\n  next = next.left;\n  next.left = new BinaryTreeNode<"+"number>(2);\n  next.right = new BinaryTreeNode<"+"number>(6);\n\n  next = root.right!;\n  next.left = new BinaryTreeNode<"+"number>(9);\n  next.right = new BinaryTreeNode<"+"number>(20);\n\n  return new BinaryTree(root);\n};\n\nconst createTreeCompleteOnly = () => {\n  /* Complete only\n   *               ____________( 8 )____________\n   *              /                             \\\n   *       ____( 4 )____                   ____(10)\n   *      /             \\                 /\n   *   ( 2 )           ( 6 )           ( 9 )\n   */\n  const root = new BinaryTreeNode<"+"number>(8);\n\n  let next = root;\n  next.left = new BinaryTreeNode<"+"number>(4);\n  next.right = new BinaryTreeNode<"+"number>(10);\n\n  next = next.left;\n  next.left = new BinaryTreeNode<"+"number>(2);\n  next.right = new BinaryTreeNode<"+"number>(6);\n\n  next = root.right!;\n  next.left = new BinaryTreeNode<"+"number>(9);\n\n  return new BinaryTree(root);\n};\n\nconst createTreeNotCompleteMutantCheck = () => {\n  /* Not complete, checks edge case of completeness algorithm\n   *                      ____________( 8 )____________\n   *                     /                             \\\n   *              ____( 4 )____                   ____(10)\n   *             /             \\                 /\n   *      ____( 2 )           ( 6 )           ( 9 )\n   *     /\n   *  ( 1 )\n   *\n   */\n  const root = new BinaryTreeNode<"+"number>(8);\n\n  let next = root;\n  next.left = new BinaryTreeNode<"+"number>(4);\n  next.right = new BinaryTreeNode<"+"number>(10);\n\n  next = next.left;\n  next.left = new BinaryTreeNode<"+"number>(2);\n  next.right = new BinaryTreeNode<"+"number>(6);\n\n  next = next.left;\n  next.left = new BinaryTreeNode<"+"number>(1);\n\n  next = root.right!;\n  next.left = new BinaryTreeNode<"+"number>(9);\n\n  return new BinaryTree(root);\n};\n\nconst createTreeFullOnly = () => {\n  /* Full only\n   *        ____________( 8 )____________\n   *       /                             \\\n   *    ( 4 )                       ____(10)_____\n   *                               /             \\\n   *                            ( 9 )           (20)\n   */\n  const root = new BinaryTreeNode<"+"number>(8);\n\n  let next = root;\n  next.left = new BinaryTreeNode<"+"number>(4);\n  next.right = new BinaryTreeNode<"+"number>(10);\n\n  next = root.right!;\n  next.left = new BinaryTreeNode<"+"number>(9);\n  next.right = new BinaryTreeNode<"+"number>(20);\n\n  return new BinaryTree(root);\n};\n\nconst createTreeCompleteAndFull = () => {\n  /* Complete, full, but not perfect\n   *               ____________( 8 )____________\n   *              /                             \\\n   *       ____( 4 )____                       (10)\n   *      /             \\\n   *   ( 2 )           ( 6 )\n   */\n  const root = new BinaryTreeNode<"+"number>(8);\n\n  let next = root;\n  next.left = new BinaryTreeNode<"+"number>(4);\n  next.right = new BinaryTreeNode<"+"number>(10);\n\n  next = next.left;\n  next.left = new BinaryTreeNode<"+"number>(2);\n  next.right = new BinaryTreeNode<"+"number>(6);\n\n  return new BinaryTree(root);\n};\n\ntype TraversalCaseSet = (BinaryTree<"+"number> | number[])[][];\ntype CheckCaseSet = BinaryTree<"+"number>[];\n\nconst cases = {\n  traversal: {\n    // [tree, result array]\n    inOrder: [\n      [createSingleNodeTree(123), [123]],\n      [createTree(), [2, 4, 6, 8, 10, 20]],\n    ],\n    preOrder: [\n      [createSingleNodeTree(123), [123]],\n      [createTree(), [8, 4, 2, 6, 10, 20]],\n    ],\n    postOrder: [\n      [createSingleNodeTree(123), [123]],\n      [createTree(), [2, 6, 4, 20, 10, 8]],\n    ],\n  },\n  checks: {\n    // [[trees matching check], [trees not matching check]]\n    isValid: [\n      createSingleNodeTree(123),\n      createTreeCompleteAndFull(),\n      createTreeCompleteOnly(),\n      createTreeDuplicates(),\n      createTreeFullOnly(),\n      createTreePerfect(),\n      createTree(),\n    ],\n    isNotValid: [createTreeInvalid(), createSingleNodeTree(NaN)],\n    hasDuplicates: [createTreeDuplicates()],\n    hasNoDuplicates: [\n      createSingleNodeTree(123),\n      createTreeCompleteAndFull(),\n      createTreeCompleteOnly(),\n      createTreeFullOnly(),\n      createTreePerfect(),\n      createTree(),\n    ],\n    isComplete: [\n      createSingleNodeTree(123),\n      createTreeCompleteAndFull(),\n      createTreeCompleteOnly(),\n      createTreePerfect(),\n    ],\n    isNotComplete: [\n      createTree(),\n      createTreeFullOnly(),\n      createTreeNotCompleteMutantCheck(),\n    ],\n    isFull: [\n      createSingleNodeTree(123),\n      createTreeCompleteAndFull(),\n      createTreeFullOnly(),\n      createTreePerfect(),\n    ],\n    isNotFull: [\n      createTree(),\n      createTreeCompleteOnly(),\n      createTreeNotCompleteMutantCheck(),\n    ],\n    isPerfect: [createTreePerfect()],\n    isNotPerfect: [\n      createTreeCompleteAndFull(),\n      createTreeCompleteOnly(),\n      createTreeFullOnly(),\n      createTree(),\n      createTreeNotCompleteMutantCheck(),\n    ],\n  },\n};\n\nlet testArray: Array<"+"number> = [];\n\nconst traversalCase = (\n  caseSet: TraversalCaseSet,\n  traversalKind: string,\n  traversalFunction: (\n    visit: (node: BinaryTreeNode<"+"number>) => void,\n    root: BinaryTreeNode<"+"number>,\n  ) => void,\n) =>\n  it.each(caseSet)(\n    `given binary tree %p, visits nodes ${traversalKind} and constructs array with length %p and value %p`,\n    (tree, expectedArray) => {\n      testArray = [];\n      traversalFunction(\n        (node) => {\n          testArray.push(node.data);\n        },\n        (tree as BinaryTree<"+"number>).root,\n      );\n      expect(testArray).toStrictEqual(expectedArray);\n    },\n  );\n\ndescribe(\"traversal\", () => {\n  describe(\"in-order traversal\", () => {\n    traversalCase(\n      cases.traversal.inOrder,\n      \"in-order\",\n      BinaryTree.inOrderTraversal<"+"number>,\n    );\n  });\n  describe(\"pre-order traversal\", () => {\n    traversalCase(\n      cases.traversal.preOrder,\n      \"pre-order\",\n      BinaryTree.preOrderTraversal<"+"number>,\n    );\n  });\n  describe(\"post-order traversal\", () => {\n    traversalCase(\n      cases.traversal.postOrder,\n      \"post-order\",\n      BinaryTree.postOrderTraversal<"+"number>,\n    );\n  });\n});\n\nconst checkCase = (\n  caseSet: CheckCaseSet,\n  checkDescription: string,\n  checkFunction: (tree: BinaryTree<"+"number>) => boolean,\n) =>\n  it.each(caseSet)(\n    `given binary tree %p, returns ${checkDescription}`,\n    (tree) => {\n      expect(checkFunction(tree)).toBe(true);\n    },\n  );\n\ndescribe(\"tree qualities\", () => {\n  checkCase(cases.checks.hasDuplicates, \"hasDuplicates === true\", (tree) =>\n    tree.hasDuplicates(),\n  );\n  checkCase(\n    cases.checks.hasNoDuplicates,\n    \"hasDuplicates === false\",\n    (tree) => !tree.hasDuplicates(),\n  );\n  checkCase(cases.checks.isComplete, \"isComplete === true\", (tree) =>\n    tree.isComplete(),\n  );\n  checkCase(\n    cases.checks.isNotComplete,\n    \"isComplete === false\",\n    (tree) => !tree.isComplete(),\n  );\n  checkCase(cases.checks.isFull, \"isFull === true\", (tree) => tree.isFull());\n  checkCase(\n    cases.checks.isNotFull,\n    \"isFull === false\",\n    (tree) => !tree.isFull(),\n  );\n  checkCase(cases.checks.isPerfect, \"isPerfect === true\", (tree) =>\n    tree.isPerfect(),\n  );\n  checkCase(\n    cases.checks.isNotPerfect,\n    \"isPerfect === false\",\n    (tree) => !tree.isPerfect(),\n  );\n  checkCase(cases.checks.isValid, \"isValidBinarySearchTree === true\", (tree) =>\n    tree.isValidBinarySearchTree(),\n  );\n  checkCase(\n    cases.checks.isNotValid,\n    \"isValidBinarySearchTree === false\",\n    (tree) => !tree.isValidBinarySearchTree(),\n  );\n});\n"},"src/data-structures/doubly-linked-list.test.ts":{"tests":[{"id":"55","name":"singly linked list default constructor does not assign a root","location":{"start":{"column":6,"line":13}}},{"id":"56","name":"singly linked list constructor successfully assigns root node when one is provided","location":{"start":{"column":6,"line":21}}},{"id":"57","name":"singly linked list linked list nodes can be connected and traversed","location":{"start":{"column":6,"line":31}}},{"id":"58","name":"singly linked list node data is accessible","location":{"start":{"column":6,"line":57}}},{"id":"59","name":"singly linked list empty length is correct","location":{"start":{"column":8,"line":71}}},{"id":"60","name":"singly linked list empty insertBeginning sets newRoot as the root for an empty linked list","location":{"start":{"column":8,"line":75}}},{"id":"61","name":"singly linked list empty removeBeginning does nothing for an empty linked list","location":{"start":{"column":8,"line":86}}},{"id":"62","name":"singly linked list empty empty linked list is not iterable","location":{"start":{"column":8,"line":96}}},{"id":"63","name":"singly linked list with 1 element length is correct","location":{"start":{"column":8,"line":120}}},{"id":"64","name":"singly linked list with 1 element removeAfter does nothing","location":{"start":{"column":8,"line":124}}},{"id":" empty length is correct","location":{"start":{"column":8,"line":71}}},{"id":"125","name":"doubly linked list empty insertBeginning sets newRoot as the root for an empty linked list","location":{"start":{"column":8,"line":75}}},{"id":"126","name":"doubly linked list empty removeBeginning does nothing for an empty linked list","location":{"start":{"column":8,"line":86}}},{"id":"127","name":"doubly linked list empty empty linked list is not iterable","location":{"start":{"column":8,"line":96}}},{"id":"128","name":"doubly linked list with 1 element length is correct","location":{"start":{"column":8,"line":120}}},{"id":"129","name":"doubly linked list with 1 element removeAfter does nothing","location":{"start":{"column":8,"line":124}}},{"id":"130","name":"doubly linked list with 1 element removeBeginning deletes the root node's properties","location":{"start":{"column":8,"line":135}}},{"id":"131","name":"doubly linked list with 3 elements linked list length is correct","location":{"start":{"column":8,"line":164}}},{"id":"132","name":"doubly linked list with 3 elements insertAfter places newNode in correct position","location":{"start":{"column":8,"line":168}}},{"id":"133","name":"doubly linked list with 3 elements insertBeginning places newRoot in correct position","location":{"start":{"column":8,"line":177}}},{"id":"134","name":"doubly linked list with 3 elements insertBeginning sets newRoot's child to old root","location":{"start":{"column":8,"line":186}}},{"id":"135","name":"doubly linked list with 3 elements length is reduced by 1 after calling removeAfter","location":{"start":{"column":8,"line":194}}},{"id":"136","name":"doubly linked list with 3 elements removeAfter removes the correct node","location":{"start":{"column":8,"line":203}}},{"id":"137","name":"doubly linked list with 3 elements removeBeginning removes the root and replaces it with the child","location":{"start":{"column":8,"line":214}}},{"id":"138","name":"doubly linked list with many elements linked list length is correct","location":{"start":{"column":8,"line":240}}},{"id":"139","name":"doubly linked list with many elements can iterate through list","location":{"start":{"column":8,"line":244}}},{"id":"140","name":"doubly linked list (specific) sets root node data correctly","location":{"start":{"column":4,"line":21}}},{"id":"141","name":"doubly linked list (specific) removeAfter sets the previous node of the node following the removed node correctly","location":{"start":{"column":6,"line":30}}},{"id":"142","name":"doubly linked list (specific) constructed with many scattered insertAfter/removeAfter calls is correctly traversed back-to-front","location":{"start":{"column":6,"line":120}}},{"id":"143","name":"doubly linked list (specific) constructed with many scattered insertAfter/removeAfter calls is correctly traversed in a back-and-forth scan pattern","location":{"start":{"column":6,"line":124}}},{"id":"144","name":"doubly linked list (specific) constructed by successive insertAfter calls at tail only is correctly traversed back-to-front","location":{"start":{"column":6,"line":145}}},{"id":"145","name":"doubly linked list (specific) constructed by successive insertAfter calls at tail only is correctly traversed in a back-and-forth scan pattern","location":{"start":{"column":6,"line":149}}},{"id":"146","name":"doubly linked list (specific) prohibits assignment of a previous node on the root","location":{"start":{"column":4,"line":154}}}],"source":"import { randomInt } from \"crypto\";\nimport {\n  DoublyLinkedList,\n  DoublyLinkedNode,\n  DoublyLinkedRootNode,\n} from \"./doubly-linked-list\";\nimport { baseLinkedNodeTests } from \"./linked-list.test\";\n\n// Repeat singly-linked-list tests that are non-specific to that data structure\nbaseLinkedNodeTests(\n  \"doubly\",\n  (node) => {\n    return new DoublyLinkedList(node);\n  },\n  (value) => {\n    return new DoublyLinkedNode(value);\n  },\n);\n\ndescribe(\"doubly linked list (specific)\", () => {\n  it(\"sets root node data correctly\", () => {\n    const value = randomInt(10000);\n    const list = new DoublyLinkedList<"+"number>(\n      new DoublyLinkedRootNode<"+"number>(value),\n    );\n    expect(list.root?.data).toBe(value);\n  });\n\n  describe(\"removeAfter\", () => {\n    it(\"sets the previous node of the node following the removed node correctly\", () => {\n      const list = new DoublyLinkedList<"+"number>();\n      let currentNode = new DoublyLinkedNode<"+"number>(0);\n      list.insertBeginning(currentNode);\n      for (let i = 1; i <"+" 10; i++) {\n        const lastNode = currentNode;\n        currentNode = new DoublyLinkedNode<"+"number>(i);\n        list.insertAfter(lastNode, currentNode);\n      }\n\n      let count = 0;\n      currentNode = list.root!.next!;\n      const middleIdx = 2 + randomInt(4);\n      while (currentNode.next !== undefined) {\n        // Test somewhere in the middle, and the node before the tail\n        if (count === middleIdx || count === list.length - 2) {\n          list.removeAfter(currentNode);\n        }\n        currentNode = currentNode.next;\n        count += 1;\n      }\n\n      let prevNode: DoublyLinkedNode<"+"number> | DoublyLinkedRootNode<"+"number> =\n        list.root!;\n      currentNode = prevNode.next!;\n      while (currentNode.next !== undefined) {\n        currentNode = currentNode.next;\n        prevNode = prevNode.next!;\n        expect(currentNode.previous).toBe(prevNode);\n        expect(prevNode.next).toBe(currentNode);\n      }\n    });\n  });\n\n  const frontToBackTraversalTest = (currentNode: DoublyLinkedNode<"+"number>) => {\n    let count = 999;\n    expect(currentNode!.next).toBeUndefined();\n    while (currentNode!.previous !== undefined) {\n      expect(currentNode!.data).toEqual(count);\n      count -= 1;\n      currentNode = currentNode!.previous;\n    }\n  };\n\n  const scanningTraversalTest = (\n    list: DoublyLinkedList<"+"number>,\n    currentNode: DoublyLinkedNode<"+"number>,\n  ) => {\n    currentNode = list.root!;\n    expect(currentNode.previous).toBeUndefined();\n    currentNode = currentNode.next!;\n    let count = 1;\n    while (currentNode.next !== undefined) {\n      expect(currentNode.data).toEqual(count);\n      count -= 1;\n      currentNode = currentNode.previous!;\n      expect(currentNode.data).toEqual(count);\n      count += 2;\n      currentNode = currentNode.next!.next!;\n      expect(currentNode.data).toEqual(count);\n    }\n  };\n\n  describe(\"constructed with many scattered insertAfter/removeAfter calls\", () => {\n    let list: DoublyLinkedList<"+"number> | undefined;\n    let currentNode: DoublyLinkedNode<"+"number> | undefined;\n    let lastNode: DoublyLinkedNode<"+"number> | undefined;\n\n    beforeEach(() => {\n      list = new DoublyLinkedList<"+"number>();\n      currentNode = new DoublyLinkedNode<"+"number>(0);\n      list.insertBeginning(currentNode);\n      const toBeRemovedAndReAdded: Array<"+"DoublyLinkedNode<"+"number>> = [];\n      for (let i = 1; i <"+" 1000; i++) {\n        lastNode = currentNode;\n        currentNode = new DoublyLinkedNode<"+"number>(i);\n        list.insertAfter(lastNode, currentNode);\n        if (randomInt(2) === 0) {\n          // 33% chance\n          toBeRemovedAndReAdded.push(currentNode);\n        }\n      }\n      for (const currentNode of toBeRemovedAndReAdded) {\n        const data = currentNode.data;\n        const previousNode = currentNode.previous!;\n        list.removeAfter(previousNode);\n        list.insertAfter(previousNode, new DoublyLinkedNode<"+"number>(data));\n      }\n    });\n\n    it(\"is correctly traversed back-to-front\", () => {\n      frontToBackTraversalTest(currentNode!);\n    });\n\n    it(\"is correctly traversed in a back-and-forth scan pattern\", () => {\n      scanningTraversalTest(list!, currentNode!);\n    });\n  });\n\n  describe(\"constructed by successive insertAfter calls at tail only\", () => {\n    let list: DoublyLinkedList<"+"number> | undefined;\n    let currentNode: DoublyLinkedNode<"+"number> | undefined;\n    let lastNode: DoublyLinkedNode<"+"number> | undefined;\n\n    beforeEach(() => {\n      list = new DoublyLinkedList<"+"number>();\n      currentNode = new DoublyLinkedNode<"+"number>(0);\n      list.insertBeginning(currentNode);\n      for (let i = 1; i <"+" 1000; i++) {\n        lastNode = currentNode;\n        currentNode = new DoublyLinkedNode<"+"number>(i);\n        list.insertAfter(lastNode, currentNode);\n      }\n    });\n\n    it(\"is correctly traversed back-to-front\", () => {\n      frontToBackTraversalTest(currentNode!);\n    });\n\n    it(\"is correctly traversed in a back-and-forth scan pattern\", () => {\n      scanningTraversalTest(list!, currentNode!);\n    });\n  });\n\n  it(\"prohibits assignment of a previous node on the root\", () => {\n    // Arrange\n    const list = new DoublyLinkedList<"+"number>(new DoublyLinkedNode<"+"number>(0));\n    // Act/Assert\n    expect(list.root!).not.toHaveProperty(\"previous\");\n    list.insertAfter(list.root!, new DoublyLinkedNode(1));\n    expect(list.root!.next).toHaveProperty(\"previous\");\n    expect(list.root!.next?.previous).toBe(list.root);\n  });\n});\n"},"src/data-structures/hash-table.test.ts":{"tests":[{"id":"75","name":"hash table defaults by default allows overwrites for the set method","location":{"start":{"column":6,"line":11}}},{"id":"76","name":"hash table defaults by default throws an error if a key targeted by delete is not found","location":{"start":{"column":6,"line":16}}},{"id":"77","name":"hash table hash function generates a unique hash across simple inputs","location":{"start":{"column":6,"line":21}}},{"id":"78","name":"hash table set should be capable of storing using an \"empty\" key","location":{"start":{"column":6,"line":40}}},{"id":"79","name":"hash table set should not overwrite values if prohibited from doing so","location":{"start":{"column":6,"line":44}}},{"id":"80","name":"hash table set should overwrite values when specified to do so","location":{"start":{"column":6,"line":50}}},{"id":"81","name":"hash table get should throw a KeyNotFoundError when called on a key that does not exist in the table","location":{"start":{"column":6,"line":58}}},{"id":"82","name":"hash table get should get values correctly in a completely filled table","location":{"start":{"column":6,"line":61}}},{"id":"83","name":"hash table delete should throw a KeyNotFoundError when called on an empty table, when specified","location":{"start":{"column":6,"line":101}}},{"id":"84","name":"hash table delete should not throw a KeyNotFoundError when called on an empty table, when specified","location":{"start":{"column":6,"line":104}}},{"id":"85","name":"hash table delete should throw a KeyNotFoundError when called on a table with collisions for a key that doesn't exist in that table","location":{"start":{"column":6,"line":109}}},{"id":"86","name":"hash table delete should not alter the table if the key is not found","location":{"start":{"column":6,"line":112}}},{"id":"87","name":"hash table delete should not alter the table if the key is not found, even when the key collides with existing keys","location":{"start":{"column":6,"line":122}}},{"id":"88","name":"hash table delete should successfully delete an entry in the table (no collisions)","location":{"start":{"column":6,"line":138}}},{"id":"89","name":"hash table delete should successfully delete an entry in a table with many collisions without affecting access to the remaining members","location":{"start":{"column":6,"line":147}}},{"id":"90","name":"hash table should store the initial set of key/value pairs when provided to the constructor","location":{"start":{"column":4,"line":168}}},{"id":"91","name":"hash table should be capable of storing two entries with colliding hashes and it should resolve the collision","location":{"start":{"column":4,"line":180}}},{"id":"92","name":"hash table should be capable of resolving many colliding hashes","location":{"start":{"column":4,"line":189}}}],"source":"import { randomInt } from \"crypto\";\nimport { HashTable, hash } from \"./hash-table\";\nimport { KeyNotFoundError } from \"../error\";\n\ndescribe(\"hash table\", () => {\n  let table: HashTable<"+"string, number>;\n  beforeEach(() => {\n    table = new HashTable<"+"string, number>(1000);\n  });\n  describe(\"defaults\", () => {\n    it(\"by default allows overwrites for the set method\", () => {\n      table.set(\"hello\", 1);\n      table.set(\"hello\", 2);\n      expect(table.get(\"hello\")).toBe(2);\n    });\n    it(\"by default throws an error if a key targeted by delete is not found\", () => {\n      expect(() => table.delete(\"hello\")).toThrow(KeyNotFoundError);\n    });\n  });\n  describe(\"hash function\", () => {\n    it(\"generates a unique hash across simple inputs\", () => {\n      const cases = [\n        \"hello\",\n        \"goodbye\",\n        253,\n        \"red\",\n        BigInt(20),\n        0b101,\n        true,\n        false,\n      ];\n      const setOfHashes: Set<"+"number> = new Set();\n      for (const input of cases) {\n        expect(setOfHashes.has(hash(input))).toBe(false);\n        setOfHashes.add(hash(input));\n      }\n    });\n  });\n  describe(\"set\", () => {\n    it('should be capable of storing using an \"empty\" key', () => {\n      table.set(\"\", 1234);\n      expect(table.get(\"\")).toBe(1234);\n    });\n    it(\"should not overwrite values if prohibited from doing so\", () => {\n      table.set(\"example\", 100);\n      expect(table.get(\"example\")).toBe(100);\n      table.set(\"example\", -987, false);\n      expect(table.get(\"example\")).toBe(100);\n    });\n    it(\"should overwrite values when specified to do so\", () => {\n      table.set(\"example\", 100);\n      expect(table.get(\"example\")).toBe(100);\n      table.set(\"example\", 987, true);\n      expect(table.get(\"example\")).toBe(987);\n    });\n  });\n  describe(\"get\", () => {\n    it(\"should throw a KeyNotFoundError when called on a key that does not exist in the table\", () => {\n      expect(() => table.get(\"example\")).toThrow(KeyNotFoundError);\n    });\n    it(\"should get values correctly in a completely filled table\", () => {\n      // Preserved below: code used to find keys that do not result in hash\n      // collisions for a table of size 10\n      /*\n      const smallerTable = new HashTable<"+"string, number>(10);\n      const uniqueIndexEntries: Set<"+"number> = new Set();\n      while (uniqueIndexEntries.size <"+" 10) {\n        const randomStr = randomInt(99999).toString();\n        const index = hash(randomStr) % 10;\n        if (!uniqueIndexEntries.has(index)) {\n          smallerTable.set(randomStr, uniqueIndexEntries.size);\n          uniqueIndexEntries.add(index);\n        }\n      }\n      console.log(smallerTable.toString());\n      */\n      // Result:\n      // 3302 47703 78241 10895 23757 88829 35396 55728 56449 18811\n      const nonCollidingKeys = [\n        \"3302\",\n        \"47703\",\n        \"78241\",\n        \"10895\",\n        \"23757\",\n        \"88829\",\n        \"35396\",\n        \"55728\",\n        \"56449\",\n        \"18811\",\n      ];\n      const smallerTable = new HashTable<"+"string, number>(10);\n      for (let i = 0; i <"+" 10; i++) {\n        smallerTable.set(nonCollidingKeys.at(i)!, i * 2);\n      }\n      for (let i = 0; i <"+" 10; i++) {\n        expect(smallerTable.get(nonCollidingKeys.at(i)!)).toBe(i * 2);\n      }\n    });\n  });\n  describe(\"delete\", () => {\n    it(\"should throw a KeyNotFoundError when called on an empty table, when specified\", () => {\n      expect(() => table.delete(\"something\", true)).toThrow(KeyNotFoundError);\n    });\n    it(\"should not throw a KeyNotFoundError when called on an empty table, when specified\", () => {\n      expect(() => table.delete(\"something\", false)).not.toThrow(\n        KeyNotFoundError,\n      );\n    });\n    it(\"should throw a KeyNotFoundError when called on a table with collisions for a key that doesn't exist in that table\", () => {\n      expect(() => table.delete(\"something\", true)).toThrow(KeyNotFoundError);\n    });\n    it(\"should not alter the table if the key is not found\", () => {\n      const smallTable = new HashTable<"+"string, number>(5);\n      smallTable.set(\"a\", 0);\n      smallTable.set(\"b\", 1);\n      smallTable.set(\"c\", 2);\n      smallTable.set(\"d\", 3);\n      const originalStr = smallTable.toString();\n      smallTable.delete(\"something\", false);\n      expect(smallTable.toString()).toStrictEqual(originalStr);\n    });\n    it(\"should not alter the table if the key is not found, even when the key collides with existing keys\", () => {\n      const smallerTable = new HashTable<"+"string, number>(1);\n      for (let i = 0; i <"+" 50; i++) {\n        smallerTable.set(`entry${i}`, i * 2);\n      }\n      const nonexistantKey = \"doesn't exist\";\n      expect(() => smallerTable.delete(nonexistantKey, true)).toThrow();\n      const checkEntries = () => {\n        for (let i = 0; i <"+" 50; i++) {\n          expect(smallerTable.get(`entry${i}`)).toBe(i * 2);\n        }\n      };\n      checkEntries();\n      smallerTable.delete(nonexistantKey, false);\n      checkEntries();\n    });\n    it(\"should successfully delete an entry in the table (no collisions)\", () => {\n      table.set(\"a\", 0);\n      table.set(\"b\", 1);\n      table.set(\"c\", 2);\n      table.set(\"d\", 3);\n      expect(table.get(\"b\")).toBe(1);\n      table.delete(\"b\", true);\n      expect(() => table.get(\"b\")).toThrow(KeyNotFoundError);\n    });\n    it(\"should successfully delete an entry in a table with many collisions without affecting access to the remaining members\", () => {\n      const smallerTable = new HashTable<"+"string, number>(10);\n      const deletedMemberKeys: Set<"+"string> = new Set();\n      for (let i = 0; i <"+" 50; i++) {\n        smallerTable.set(`entry${i}`, i * 2);\n        if (randomInt(3) === 0) {\n          // 1/3 chance\n          deletedMemberKeys.add(`entry${i}`);\n        }\n      }\n      for (const key of deletedMemberKeys) {\n        smallerTable.delete(key, true);\n      }\n      for (let i = 0; i <"+" 50; i++) {\n        if (deletedMemberKeys.has(`entry${i}`)) {\n          continue;\n        }\n        expect(smallerTable.get(`entry${i}`)).toBe(i * 2);\n      }\n    });\n  });\n  it(\"should store the initial set of key/value pairs when provided to the constructor\", () => {\n    const initialPairs: Array<"+"[string, number]> = [\n      [\"0\", 1000],\n      [\"1\", 2345],\n      [\"2\", 303],\n      [\"3\", 404],\n    ];\n    const smallerTable = new HashTable<"+"string, number>(10, initialPairs);\n    for (let i = 0; i <"+" 4; i++) {\n      expect(smallerTable.get(i.toString())).toBe(initialPairs.at(i)![1]);\n    }\n  });\n  it(\"should be capable of storing two entries with colliding hashes and it should resolve the collision\", () => {\n    const stringA = \"Aa\";\n    const stringB = \"BB\";\n    expect(hash(stringA)).toStrictEqual(hash(stringB));\n    table.set(stringA, 123);\n    table.set(stringB, 987);\n    expect(table.get(stringA)).toBe(123);\n    expect(table.get(stringB)).toBe(987);\n  });\n  it(\"should be capable of resolving many colliding hashes\", () => {\n    // With a table size of 10 and 20 elements to store, there are guaranteed\n    // to be collisions (pigeonhole principle - the index is generated from the\n    // hash using `mod length`)\n    const smallerTable = new HashTable<"+"string, number>(10);\n    for (let i = 0; i <"+" 20; i++) {\n      smallerTable.set(`entry${i}`, i * 2);\n    }\n    for (let i = 0; i <"+" 20; i++) {\n      expect(smallerTable.get(`entry${i}`)).toBe(i * 2);\n    }\n  });\n});\n"},"src/algorithms/sort-radix.test.ts":{"tests":[{"id":"93","name":"selection sort does not throw an error when called on an empty array","location":{"start":{"column":6,"line":28}}},{"id":" > {\n    expect(getNumberOfDigits(10)).toBe(2);\n  });\n  it(\"returns 3 digits for 100\", () => {\n    expect(getNumberOfDigits(100)).toBe(3);\n  });\n  it(\"returns 1 digit for other one-digit numbers\", () => {\n    const array = [2, 3, 4, 5, 6, 7, 8, 9];\n    for (const i of array) {\n      expect(getNumberOfDigits(i)).toBe(1);\n    }\n  });\n  it(\"returns 2 digits for two-digit numbers\", () => {\n    for (let i = 0; i <"+" 1000; i++) {\n      const randomNum = (randomInt(9) + 1) * 10 + randomInt(10);\n      expect(getNumberOfDigits(randomNum)).toBe(2);\n    }\n  });\n  it(\"returns 3 digits for three-digit numbers\", () => {\n    for (let i = 0; i <"+" 1000; i++) {\n      const randomNum =\n        (randomInt(9) + 1) * 100 + (randomInt(9) + 1) * 10 + randomInt(10);\n      expect(getNumberOfDigits(randomNum)).toBe(3);\n    }\n  });\n  it(\"returns the correct number of digits for many-digit numbers\", () => {\n    for (let i = 0; i <"+" 1000; i++) {\n      const numDigits = randomInt(10) + 4;\n      let randomNum = randomInt(10);\n      for (let j = 1; j <"+" numDigits; j++) {\n        randomNum += (randomInt(9) + 1) * 10 ** j;\n      }\n      expect(getNumberOfDigits(randomNum)).toBe(numDigits);\n    }\n  });\n});\n\ndescribe(\"getDigit\", () => {\n  it(\"throws an error for non-positive integer input for the value arg\", () => {\n    expect(() => getDigit(-1, 0)).toThrow();\n  });\n  it(\"throws an error for non-positive integer input for the fromRightIdx arg\", () => {\n    expect(() => getDigit(100, -1)).toThrow();\n  });\n  it(\"throws an error for non-integer input for the value arg\", () => {\n    expect(() => getDigit(4102.419, 1)).toThrow();\n  });\n  it(\"returns 0 as the 1st digit from the right for 0\", () => {\n    expect(getDigit(0, 0)).toBe(0);\n  });\n  it(\"returns 0 as the 1st digit from the right for 10\", () => {\n    expect(getDigit(10, 0)).toBe(0);\n  });\n  it(\"returns 1 as the 2nd digit from the right for 10\", () => {\n    expect(getDigit(10, 1)).toBe(1);\n  });\n  it(\"returns 7 and 8 as the 1st digit from the right for 37, 38\", () => {\n    expect(getDigit(37, 0)).toBe(7);\n    expect(getDigit(38, 0)).toBe(8);\n  });\n  it(\"returns each digit from the right correctly for 123456789\", () => {\n    const number = 123456789;\n    for (let i = 0; i <"+" 9; i++) {\n      expect(getDigit(number, i)).toBe(9 - i);\n    }\n  });\n  it(\"returns 0 as the digit if the value has less digits than the requested digit\", () => {\n    expect(getDigit(123, 4)).toBe(0);\n    expect(getDigit(1234, 4)).toBe(0);\n    expect(getDigit(9999, 4)).toBe(0);\n  });\n});\n\nbaseSortAlgorithmTests(\n  \"radix sort\",\n  function (collection: Collection<"+"number>) {\n    radixSort(collection, arrayCopyToFunction);\n  },\n  false,\n);\n\ndescribe(\"radix sort (specific)\", () => {\n  it(\"uses the correct max number of digits\", () => {\n    // Arrange\n    const initialArray = [1, 2, 3000, 4, 5];\n    const array = structuredClone(initialArray);\n    // Act\n    radixSort(array, arrayCopyToFunction);\n    // Assert\n    expect(array).not.toStrictEqual(initialArray);\n    expect(array).toStrictEqual([1, 2, 4, 5, 3000]);\n  });\n});\n"},"src/data-structures/avl-tree.test.ts":{"tests":[{"id":"147","name":"AVL tree getBalance given binary tree {\"root\": [BinaryTreeNode]}, returns balance of 0","location":{"start":{"column":8,"line":132}}},{"id":"148","name":"AVL tree getBalance given binary tree {\"root\": [BinaryTreeNode]}, returns balance of 2","location":{"start":{"column":8,"line":132}}},{"id":"149","name":"AVL tree getBalance given binary tree {\"root\": [BinaryTreeNode]}, returns balance of -2","location":{"start":{"column":8,"line":132}}},{"id":"258","name":"AVL tree balance given binary tree {\"root\": [BinaryTreeNode]}, returns balance of 0","location":{"start":{"column":8,"line":132}}},{"id":"259","name":"AVL tree balance given binary tree {\"root\": [BinaryTreeNode]}, returns balance of 2","location":{"start":{"column":8,"line":132}}},{"id":"260","name":"AVL tree balance given binary tree {\"root\": [BinaryTreeNode]}, returns balance of -2","location":{"start":{"column":8,"line":132}}}],"source":"import { AVLTree, AVLTreeNodeDataWrapper } from \"./binary-search-tree\";\nimport { BinaryTreeNode } from \"./binary-tree-node\";\n\ntype AVLTreeNode = AVLTreeNodeDataWrapper<"+"number>;\n\nconst createBalancedAVLTree = () => {\n  /*\n   *               ____________(20)____________\n   *              /                            \\\n   *       ____(10)____                   ____(30)____\n   *      /            \\                 /            \\\n   *    (5)           (15)             (25)          (35)\n   */\n  const root = new BinaryTreeNode<"+"AVLTreeNode>({\n    innerData: 20,\n    height: 3,\n  });\n\n  let next = root;\n  next.left = new BinaryTreeNode<"+"AVLTreeNode>({ innerData: 10, height: 2 });\n  next.right = new BinaryTreeNode<"+"AVLTreeNode>({ innerData: 30, height: 2 });\n\n  next = next.left;\n  next.left = new BinaryTreeNode<"+"AVLTreeNode>({ innerData: 5, height: 1 });\n  next.right = new BinaryTreeNode<"+"AVLTreeNode>({ innerData: 15, height: 1 });\n\n  next = root.right!;\n  next.left = new BinaryTreeNode<"+"AVLTreeNode>({ innerData: 25, height: 1 });\n  next.right = new BinaryTreeNode<"+"AVLTreeNode>({ innerData: 35, height: 1 });\n\n  return new AVLTree(root);\n};\n\nconst createLeftRightShapeAVLTree = () => {\n  /*\n   *               ____________(30)____________\n   *              /                            \\\n   *       ____(10)____                       (35)\n   *      /            \\\n   *    (5)       ____(20)____\n   *             /            \\\n   *          (15)           (25)\n   */\n  const root = new BinaryTreeNode<"+"AVLTreeNode>({\n    innerData: 30,\n    height: 4,\n  });\n\n  let next = root;\n  next.left = new BinaryTreeNode<"+"AVLTreeNode>({ innerData: 10, height: 3 });\n  next.right = new BinaryTreeNode<"+"AVLTreeNode>({ innerData: 35, height: 1 });\n\n  next = next.left;\n  next.left = new BinaryTreeNode<"+"AVLTreeNode>({ innerData: 5, height: 1 });\n  next.right = new BinaryTreeNode<"+"AVLTreeNode>({ innerData: 20, height: 2 });\n\n  next = next.right;\n  next.left = new BinaryTreeNode<"+"AVLTreeNode>({ innerData: 15, height: 1 });\n  next.right = new BinaryTreeNode<"+"AVLTreeNode>({ innerData: 25, height: 1 });\n\n  return new AVLTree(root);\n};\n\nconst createLeftLeftShapeAVLTree = () => {\n  /*\n   *                    ____________(30)____________\n   *                   /                            \\\n   *            ____(20)____                       (35)\n   *           /            \\\n   *     ____(10)____      (25)\n   *    /            \\\n   *  (5)           (15)\n   *\n   */\n  const root = new BinaryTreeNode<"+"AVLTreeNode>({\n    innerData: 30,\n    height: 4,\n  });\n\n  let next = root;\n  next.left = new BinaryTreeNode<"+"AVLTreeNode>({ innerData: 20, height: 3 });\n  next.right = new BinaryTreeNode<"+"AVLTreeNode>({ innerData: 35, height: 1 });\n\n  next = next.left;\n  next.left = new BinaryTreeNode<"+"AVLTreeNode>({ innerData: 10, height: 2 });\n  next.right = new BinaryTreeNode<"+"AVLTreeNode>({ innerData: 25, height: 1 });\n\n  next = next.left;\n  next.left = new BinaryTreeNode<"+"AVLTreeNode>({ innerData: 5, height: 1 });\n  next.right = new BinaryTreeNode<"+"AVLTreeNode>({ innerData: 15, height: 1 });\n\n  return new AVLTree(root);\n};\n\nconst createRightLeftShapeAVLTree = () => {\n  /*\n   *      ____________(10)____________\n   *     /                            \\\n   *   (5)                       ____(30)____\n   *                            /            \\\n   *                      ____(20)____      (35)\n   *                     /            \\\n   *                  (15)           (25)\n   */\n  const root = new BinaryTreeNode<"+"AVLTreeNode>({\n    innerData: 10,\n    height: 4,\n  });\n\n  let next = root;\n  next.left = new BinaryTreeNode<"+"AVLTreeNode>({ innerData: 5, height: 1 });\n  next.right = new BinaryTreeNode<"+"AVLTreeNode>({ innerData: 30, height: 3 });\n\n  next = next.right;\n  next.left = new BinaryTreeNode<"+"AVLTreeNode>({ innerData: 20, height: 2 });\n  next.right = new BinaryTreeNode<"+"AVLTreeNode>({ innerData: 35, height: 1 });\n\n  next = next.left;\n  next.left = new BinaryTreeNode<"+"AVLTreeNode>({ innerData: 15, height: 1 });\n  next.right = new BinaryTreeNode<"+"AVLTreeNode>({ innerData: 25, height: 1 });\n\n  return new AVLTree(root);\n};\n\ndescribe(\"AVL tree\", () => {\n  describe(\"getBalance\", () => {\n    it.each([\n      [createBalancedAVLTree(), 0],\n      [createLeftLeftShapeAVLTree(), 2],\n      [createLeftRightShapeAVLTree(), 2],\n      [createRightLeftShapeAVLTree(), -2],\n    ])(\n      `given binary tree %p, returns balance of %p`,\n      (tree, expectedBalance) => {\n        expect(AVLTree.getBalance(tree.root)).toBe(expectedBalance);\n      },\n    );\n  });\n});\n"},"src/algorithms/search-string.test.ts":{"tests":[{"id":"150","name":"Rabin-Karp Substring Search finds no matches when the substring is absent","location":{"start":{"column":4,"line":24}}},{"id":"151","name":"Rabin-Karp Substring Search is case sensitive","location":{"start":{"column":4,"line":28}}},{"id":"152","name":"Rabin-Karp Substring Search can match digits","location":{"start":{"column":4,"line":35}}},{"id":"153","name":"Rabin-Karp Substring Search can match digits (mixed)","location":{"start":{"column":4,"line":40}}},{"id":"154","name":"Rabin-Karp Substring Search can match special symbols","location":{"start":{"column":4,"line":45}}},{"id":"155","name":"Rabin-Karp Substring Search can match special symbols (mixed)","location":{"start":{"column":4,"line":50}}},{"id":"156","name":"Rabin-Karp Substring Search finds 1 match when the substring is only present once","location":{"start":{"column":4,"line":55}}},{"id":"157","name":"Rabin-Karp Substring Search finds 3 matches when the substring is present three times","location":{"start":{"column":4,"line":60}}},{"id":"158","name":"Rabin-Karp Substring Search can match at the start of the string","location":{"start":{"column":4,"line":68}}},{"id":"159","name":"Rabin-Karp Substring Search can match at the end of the string","location":{"start":{"column":4,"line":73}}},{"id":"160","name":"Rabin-Karp Substring Search can match on a 1-character-long substring","location":{"start":{"column":4,"line":78}}},{"id":"161","name":"Rabin-Karp Substring Search with simplified hash functions checks for false matches","location":{"start":{"column":6,"line":105}}},{"id":"162","name":"Rabin-Karp Substring Search with simplified hash functions may create false matches prior to performing checks","location":{"start":{"column":6,"line":115}}}],"source":"import {\n  rabinKarpSubstringSearch,\n  Hash,\n  getCodeForCharacter,\n  Character,\n  getRabinKarpSearchCandidates,\n} from \"./search-string\";\n\n// describe(\"hashing implementation\", () => {\n//   it(\"does not exceed safe integer storage size in JavaScript\", () => {\n//     let highValueSubstring: string = \"\";\n//     for (let i = 0; i <"+" 100; i++) {\n//       highValueSubstring += \"~\";\n//     }\n//     const hash = getRabinFingerprintHash(highValueSubstring);\n//     // console.log(`${hash}, or: 2^${Math.log2(hash)}`);\n//     expect(Number.isSafeInteger(hash)).toBe(\n//       true,\n//     );\n//   });\n// });\n\ndescribe(\"Rabin-Karp Substring Search\", () => {\n  it(\"finds no matches when the substring is absent\", () => {\n    const indices = rabinKarpSubstringSearch(\"There are no matches.\", \"happy\");\n    expect(indices.length).toBe(0);\n  });\n  it(\"is case sensitive\", () => {\n    const indices = rabinKarpSubstringSearch(\n      \"I learned bears love pears\",\n      \"Ear\",\n    );\n    expect(indices.length).toBe(0);\n  });\n  it(\"can match digits\", () => {\n    const indices = rabinKarpSubstringSearch(\"01234567\", \"34\");\n    expect(indices).toEqual([3]);\n    expect(indices.length).toBe(1);\n  });\n  it(\"can match digits (mixed)\", () => {\n    const indices = rabinKarpSubstringSearch(\"Not strict1y 1337speak\", \"7sp\");\n    expect(indices).toEqual([16]);\n    expect(indices.length).toBe(1);\n  });\n  it(\"can match special symbols\", () => {\n    const indices = rabinKarpSubstringSearch(\"!@#$*%@(#?\", \"*%\");\n    expect(indices).toEqual([4]);\n    expect(indices.length).toBe(1);\n  });\n  it(\"can match special symbols (mixed)\", () => {\n    const indices = rabinKarpSubstringSearch(\"What's that, hm?\", \"hm?\");\n    expect(indices).toEqual([13]);\n    expect(indices.length).toBe(1);\n  });\n  it(\"finds 1 match when the substring is only present once\", () => {\n    const indices = rabinKarpSubstringSearch(\"I spy something red.\", \"thing\");\n    expect(indices).toEqual([10]);\n    expect(indices.length).toBe(1);\n  });\n  it(\"finds 3 matches when the substring is present three times\", () => {\n    const indices = rabinKarpSubstringSearch(\n      \"I learned bears love pears.\",\n      \"ear\",\n    );\n    expect(indices).toEqual([3, 11, 22]);\n    expect(indices.length).toBe(3);\n  });\n  it(\"can match at the start of the string\", () => {\n    const indices = rabinKarpSubstringSearch(\"Hello goodbye.\", \"Hello\");\n    expect(indices).toEqual([0]);\n    expect(indices.length).toBe(1);\n  });\n  it(\"can match at the end of the string\", () => {\n    const indices = rabinKarpSubstringSearch(\"Hello goodbye.\", \"bye.\");\n    expect(indices).toEqual([10]);\n    expect(indices.length).toBe(1);\n  });\n  it(\"can match on a 1-character-long substring\", () => {\n    const indices = rabinKarpSubstringSearch(\"I spy something red.\", \"e\");\n    expect(indices).toEqual([9, 17]);\n    expect(indices.length).toBe(2);\n  });\n\n  describe(\"with simplified hash functions\", () => {\n    const hashFunctionWithCollisions = (substring: string): Hash => {\n      let hashValue: Hash = BigInt(0);\n      for (let i = 0; i <"+" substring.length; i++) {\n        hashValue += getCodeForCharacter(substring.at(i)!);\n      }\n      return hashValue;\n    };\n\n    const rollHashFunction = (\n      _substringLength: number,\n      hash: Hash,\n      startCharacter: Character,\n      endCharacter: Character,\n    ): Hash => {\n      let resultHash = hash;\n      resultHash -= getCodeForCharacter(startCharacter);\n      resultHash += getCodeForCharacter(endCharacter);\n      return resultHash;\n    };\n\n    it(\"checks for false matches\", () => {\n      const indices = rabinKarpSubstringSearch(\n        \"CAB BACK CABLE\",\n        \"BA\",\n        hashFunctionWithCollisions,\n        rollHashFunction,\n      );\n      expect(indices).toEqual([4]);\n      expect(indices.length).toBe(1);\n    });\n    it(\"may create false matches prior to performing checks\", () => {\n      const sourceString = \"CAB BACK CABLE\";\n      const substring = \"BA\";\n\n      const candidates = getRabinKarpSearchCandidates(\n        sourceString,\n        substring,\n        hashFunctionWithCollisions,\n        rollHashFunction,\n      );\n      expect(candidates).toEqual([1, 4, 8, 10]);\n      expect(candidates.length).toBe(4);\n\n      const indices = rabinKarpSubstringSearch(\n        sourceString,\n        substring,\n        hashFunctionWithCollisions,\n        rollHashFunction,\n      );\n      expect(indices).not.toEqual(candidates);\n      expect(indices.length).not.toBe(candidates.length);\n    });\n  });\n});\n"},"src/data-structures/queue.test.ts":{"tests":[{"id":"190","name":"queue (array implementation) constructor should successfully initialize the elements of a queue given an iterable","location":{"start":{"column":8,"line":10}}},{"id":"191","name":"queue (array implementation) add, remove, first removing elements from an empty queue should not change the length","location":{"start":{"column":8,"line":18}}},{"id":"192","name":"queue (array implementation) add, remove, first should suc Be(randomNum);\n        }\n      });\n      it(\"should support duplicate elements\", () => {\n        const queue = queueConstructor([1, 2, 3, 3, 3]);\n        expect(queue.remove()).toBe(1);\n        expect(queue.remove()).toBe(2);\n        expect(queue.remove()).toBe(3);\n        expect(queue.remove()).toBe(3);\n        expect(queue.remove()).toBe(3);\n      });\n      it(\"should successfully add an element to the back of a queue containing non-duplicate elements\", () => {\n        const queue = queueConstructor();\n        for (let i = 0; i <"+" 100; i++) {\n          queue.add(i);\n        }\n        expect(queue.length).toBe(100);\n        queue.add(100);\n        expect(queue.length).toBe(101);\n        expect(queue.first).not.toBe(100);\n        for (let i = 0; i <"+" 100; i++) {\n          queue.remove();\n        }\n        expect(queue.length).toBe(1);\n        expect(queue.first).toBe(100);\n      });\n      it(\"should be able to remove and then add elements successfully\", () => {\n        const queue = queueConstructor();\n        for (let i = 0; i <"+" 10; i++) {\n          queue.add(i);\n          queue.add(i);\n          queue.remove();\n        }\n        expect(queue.length).toBe(10);\n        expect(queue.first).toBe(5);\n      });\n      it(\"should return undefined for the first element of an empty queue\", () => {\n        const queue = queueConstructor();\n        expect(queue.first).toBe(undefined);\n      });\n    });\n    describe(\"isEmpty\", () => {\n      it(\"should indicate that an empty queue is empty\", () => {\n        const queue = queueConstructor();\n        expect(queue.length).toBe(0);\n        expect(queue.isEmpty).toBe(true);\n      });\n      it(\"should indicate that a previously filled but now-empty queue is empty\", () => {\n        // Arrange\n        const queue = queueConstructor([1, 2, 3]);\n        expect(queue.length).not.toBe(0);\n        expect(queue.isEmpty).not.toBe(true);\n        // Act\n        queue.remove();\n        queue.remove();\n        queue.remove();\n        // Assert\n        expect(queue.length).toBe(0);\n        expect(queue.isEmpty).toBe(true);\n      });\n    });\n  });\n};\n\nbaseQueueTests(\"array implementation\", (iterable) => {\n  return new QueueArray(iterable);\n});\nbaseQueueTests(\"LinkedList implementation\", (iterable) => {\n  return new QueueLinkedList(iterable);\n});\n"},"src/data-structures/stack.test.ts":{"tests":[{"id":"208","name":"stack (array implementation) constructor should successfully initialize the elements of a stack given an iterable","location":{"start":{"column":8,"line":10}}},{"id":"209","name":"stack (array implementation) push, pop, top popping elements off of an empty stack should not change the length","location":{"start":{"column":8,"line":18}}},{"id":"210","name":"stack (array implementation) push, pop, top should successfully push an element onto an empty stack","location":{"start":{"column":8,"line":27}}},{"id":"211","name":"stack (array implementation) push, pop, top should support duplicate elements","location":{"start":{"column":8,"line":35}}},{"id":"212","name":"stack (array implementation) push, pop, top should successfully push an element onto a stack containing non-duplicate elements","location":{"start":{"column":8,"line":43}}},{"id":"213","name":"stack (array implementation) push, pop, top should be able to pop and then push elements onto the stack successfully","location":{"start":{"column":8,"line":58}}},{"id":"214","name":"stack (array implementation) push, pop, top should return undefined for the top element of an empty stack","location":{"start":{"column":8,"line":68}}},{"id":"215","name":"stack (array implementation) isEmpty should indicate that an empty stack is empty","location":{"start":{"column":8,"line":74}}},{"id":"216","name":"stack (array implementation) isEmpty should indicate that a previously filled but now-empty stack is empty","location":{"start":{"column":8,"line":79}}},{"id":"217","na => {\n        const stack = stackConstructor([1, 2, 3]);\n        expect(stack.pop()).toBe(3);\n        expect(stack.pop()).toBe(2);\n        expect(stack.pop()).toBe(1);\n      });\n    });\n    describe(\"push, pop, top\", () => {\n      it(\"popping elements off of an empty stack should not change the length\", () => {\n        const stack = stackConstructor();\n        stack.push(1);\n        expect(stack.length).toBe(1);\n        for (let i = 0; i <"+" 10; i++) {\n          stack.pop();\n          expect(stack.length).toBe(0);\n        }\n      });\n      it(\"should successfully push an element onto an empty stack\", () => {\n        for (let i = 0; i <"+" 100; i++) {\n          const stack = stackConstructor();\n          const randomNum = randomInt(1000);\n          stack.push(randomNum);\n          expect(stack.top).toBe(randomNum);\n        }\n      });\n      it(\"should support duplicate elements\", () => {\n        const stack = stackConstructor([1, 2, 3, 3, 3]);\n        expect(stack.pop()).toBe(3);\n        expect(stack.pop()).toBe(3);\n        expect(stack.pop()).toBe(3);\n        expect(stack.pop()).toBe(2);\n        expect(stack.pop()).toBe(1);\n      });\n      it(\"should successfully push an element onto a stack containing non-duplicate elements\", () => {\n        const stack = stackConstructor();\n        for (let i = 0; i <"+" 100; i++) {\n          stack.push(i);\n        }\n        expect(stack.length).toBe(100);\n        stack.push(100);\n        expect(stack.length).toBe(101);\n        expect(stack.top).not.toBe(0);\n        for (let i = 0; i <"+" 100; i++) {\n          stack.pop();\n        }\n        expect(stack.length).toBe(1);\n        expect(stack.top).toBe(0);\n      });\n      it(\"should be able to pop and then push elements onto the stack successfully\", () => {\n        const stack = stackConstructor();\n        for (let i = 0; i <"+" 10; i++) {\n          stack.push(i);\n          stack.push(i);\n          stack.pop();\n
