es: Array<"+"TestCase> = [\n  {\n    description: \"empty\",\n    collection: [],\n    expectedIndex: -1,\n    searchValue: 0,\n  },\n  {\n    description: \"simple\",\n    collection: [0, 1, 2],\n    expectedIndex: 0,\n    searchValue: 0,\n  },\n  {\n    description: \"negative start\",\n    collection: [-2, -1, 0, 1, 2],\n    expectedIndex: 2,\n    searchValue: 0,\n  },\n  {\n    description: \"negative throughout\",\n    collection: [-5, -4, -3, -2, -1],\n    expectedIndex: 3,\n    searchValue: -2,\n  },\n  {\n    description: \"contains repeats\",\n    collection: [0, 0, 0, 1, 2, 2, 3, 4, 4, 5, 9, 9, 10, 15],\n    expectedIndex: 9,\n    searchValue: 5,\n  },\n  {\n    description: \"random list\",\n    ...shortListCase,\n  },\n  {\n    description: \"long, random list\",\n    ...longListCase,\n  },\n  {\n    description: \"very long, random list\",\n    ...longerListCase,\n  },\n  {\n    description: \"even longer, random list\",\n    ...longestListCase,\n  },\n];\n\ndescribe(\"linear search\", () => {\n  for (const testCase of testCases) {\n    it(`returns idx=${testCase.expectedIndex} for value=${testCase.searchValue}\n       ${\n         testCase.collection.length <"+"= 10\n           ? `in [${testCase.collection}] -`\n           : \"-\"\n       } ${testCase.description}`, () => {\n      const idx: Index = linearSearch(\n        testCase.collection,\n        (element) => element === testCase.searchValue,\n      );\n      expect(idx).toEqual(testCase.expectedIndex);\n    });\n  }\n});\n\ndescribe(\"binary search\", () => {\n  for (const testCase of testCases) {\n    const predicate = (element: number) => {\n      if (testCase.searchValue > element) {\n        return 1;\n      }\n      if (testCase.searchValue <"+" element) {\n        return -1;\n      }\n      return 0;\n    };\n\n    it(`returns idx=${testCase.expectedIndex} for value=${testCase.searchValue}\n       ${\n         testCase.collection.length <"+"= 10\n           ? `in [${testCase.collection}] -`\n           : \"-\"\n       } ${testCase.description}`, () => {\n      const idx: Index = binarySearch<"+"Array<"+"number>, number>(\n        testCase.collection,\n        predicate,\n      );\n      expect(idx).toEqual(testCase.expectedIndex);\n    });\n  }\n});\n"},"src/util.test.ts":{"tests":[{"id":"244","name":"deleteObjectProperties successfully deletes all object properties","location":{"start":{"column":4,"line":9}}},{"id":"245","name":"deleteObjectProperties does not throw if object is undefined","location":{"start":{"column":4,"line":34}}},{"id":"246","name":"isSorted returns true for a collection of size 0","location":{"start":{"column":4,"line":43}}},{"id":"247","name":"isSorted returns true for a collection of size 1","location":{"start":{"column":4,"line":46}}},{"id":"248","name":"undefined/NaN detection should return true for NaN","location":{"start":{"column":4,"line":52}}},{"id":"249","name":"undefined/NaN detection should return true for undefined","location":{"start":{"column":4,"line":55}}},{"id":"250","name":"undefined/NaN detection should return true for infinity","location":{"start":{"column":4,"line":58}}},{"id":"251","name":"undefined/NaN detection should return true for negative infinity","location":{"start":{"column":4,"line":61}}},{"id":"252","name":"undefined/NaN detection should return false for a defined number","location":{"start":{"column":4,"line":64}}},{"id":"253","name":"undefined/NaN detection isDefinedAndNotNaN should return false if the input is undefined","location":{"start":{"column":6,"line":68}}},{"id":"254","name":"undefined/NaN detection isDefinedAndNotNaN should return false if the input is NaN (with type number)","location":{"start":{"column":6,"line":72}}},{"id":"255","name":"undefined/NaN detection isDefinedAndNotNaN should return true if the input number is Infinity or -Infinity","location":{"start":{"column":36,"line":78}}},{"id":"256","name":"undefined/NaN detection isDefinedAndNotNaN should return true for a variety of defined non-numbers","location":{"start":{"column":8,"line":93}}},{"id":"257","name":"undefined/NaN detection isDefinedAndNotNaN should return true for a variety of defined numbers, rational or irrational","location":{"start":{"column":8,"line":105}}}],"source":"import {\n  IsValidFiniteNumber,\n  deleteObjectProperties,\n  isDefinedAndNotNaN,\n  isSorted,\n} from \"./util\";\n\ndescribe(\"deleteObjectProperties\", () => {\n  it(\"successfully deletes all object properties\", () => {\n    // Arrange\n    const obj = {\n      a: \"hello\",\n      b: 5,\n      c: true,\n      d() {\n        return \"example A\";\n      },\n      e: () => {\n        return \"example B\";\n      },\n    };\n\n    // Act\n    deleteObjectProperties(obj);\n\n    // Assert\n    expect(obj).not.toHaveProperty(\"a\");\n    expect(obj).not.toHaveProperty(\"b\");\n    expect(obj).not.toHaveProperty(\"c\");\n    expect(obj).not.toHaveProperty(\"d\");\n    expect(obj).not.toHaveProperty(\"e\");\n  });\n\n  it(\"does not throw if object is undefined\", () => {\n    const obj = undefined;\n    expect(() => {\n      deleteObjectProperties(obj);\n    }).not.toThrow();\n  });\n});\n\ndescribe(\"isSorted\", () => {\n  it(\"returns true for a collection of size 0\", () => {\n    expect(isSorted([])).toBe(true);\n  });\n  it(\"returns true for a collection of size 1\", () => {\n    expect(isSorted([123])).toBe(true);\n  });\n});\n\ndescribe(\"undefined/NaN detection\", () => {\n  it(\"should return true for NaN\", () => {\n    expect(IsValidFiniteNumber(NaN)).toBe(false);\n  });\n  it(\"should return true for undefined\", () => {\n    expect(IsValidFiniteNumber(undefined)).toBe(false);\n  });\n  it(\"should return true for infinity\", () => {\n    expect(IsValidFiniteNumber(Infinity)).toBe(false);\n  });\n  it(\"should return true for negative infinity\", () => {\n    expect(IsValidFiniteNumber(-Infinity)).toBe(false);\n  });\n  it(\"should return false for a defined number\", () => {\n    expect(IsValidFiniteNumber(5)).toBe(true);\n  });\n  describe(\"isDefinedAndNotNaN\", () => {\n    it(\"should return false if the input is undefined\", () => {\n      const undefinedExample = undefined;\n      expect(isDefinedAndNotNaN(undefinedExample)).toBe(false);\n    });\n    it(\"should return false if the input is NaN (with type number)\", () => {\n      const notANumber: number = NaN;\n      const undefinedExample: number | undefined = undefined;\n      expect(isDefinedAndNotNaN(notANumber)).toBe(false);\n      expect(isDefinedAndNotNaN(undefinedExample! + 50)).toBe(false);\n    });\n    it.each([Infinity, -Infinity])(\n      \"should return true if the input number is Infinity or -Infinity\",\n      (input) => {\n        expect(isDefinedAndNotNaN(input)).toBe(true);\n      },\n    );\n    it.each([\n      \"hello\",\n      \"\",\n      \"undefined\",\n      \"NaN\",\n      new Set(),\n      new Map(),\n      {},\n      [1, 2, 3],\n    ])(\"should return true for a variety of defined non-numbers\", (input) => {\n      expect(isDefinedAndNotNaN(input)).toBe(true);\n    });\n    it.each([\n      0,\n      -0,\n      100,\n      -100,\n      Math.E,\n      Math.PI,\n      Number.MAX_VALUE,\n      Number.MIN_VALUE,\n    ])(\n      \"should return true for a variety of defined numbers, rational or irrational\",\n      (input) => {\n        expect(isDefinedAndNotNaN(input)).toBe(true);\n      },\n    );\n  });\n});\n"}},"projectRoot":"/home/jt/repos/TypeScriptDataStructuresAndAlgorithms","config":{"$schema":"./node_modules/@stryker-mutator/core/schema/stryker-schema.json","checkers":["typescript"],"coverageAnalysis":"perTest","ignorePatterns":["dist",".venv","reports"],"incremental":true,"packageManager":"pnpm","plugins":["@stryker-mutator/jest-runner","@stryker-mutator/typescript-checker"],"reporters":["html","clear-text","progress"],"testRunner":"jest","testRunnerNodeArgs":["--expose-gc"],"tsconfigFile":"tsconfig.json","typescriptChecker":{"prioritizePerformanceOverAc
